import React from "react";

const JasonSVG = ({ playCors }) => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="392"
      height="446"
      fill="none"
      viewBox="0 0 392 446"
      onClick={playCors}
    >
      <rect width="392" height="446" fill="url(#pattern0)" rx="188.5"></rect>
      <defs>
        <pattern
          id="pattern0"
          width="1"
          height="1"
          patternContentUnits="objectBoundingBox"
        >
          <use
            transform="matrix(.00736 0 0 .00622 -.958 -.516)"
            xlinkHref="#image0"
          ></use>
        </pattern>
        <image
          id="image0"
          width="400"
          height="400"
          xlinkHref="data:image/png;base64,"
        ></image>
      </defs>
    </svg>
  );
};

export default JasonSVG;
